import "./App.css";
import axios from "axios";
import { useEffect, useState } from "react";
function App() {
  const [listOsPosts, setListOfPosts] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:3001/posts").then((response) => {
      setListOfPosts(response.data);
    });
  }, []);
  return (
    <div className="App">
      {listOsPosts.map((value, key) => {
        return <div>{value.tittle}</div>;
      })}
    </div>
  );
}

export default App;
